`),p(7,"div",5)(8,"p"),g(9,"Mgr in\u017C. Jacek Kiczek. Wiek 50 lat. Rodowity rzeszowianin od trzech pokole\u0144. Absolwent Technikum Budowlanego w Rzeszowie oraz Politechniki Krakowskiej Wydzia\u0142u In\u017Cynierii L\u0105dowej. Specjalizacja drogi kolejowe oraz budownictwo og\xF3lne. W czasie studi\xF3w dzia\u0142a\u0142 w NZS kieruj\u0105c ca\u0142\u0105 krakowsk\u0105 organizacj\u0105."),h(),p(10,"p"),g(11,"Posiada uprawnienia do kierowania robotami budowlanymi oraz nadzoru bez ogranicze\u0144 w bran\u017Cy kolejowej, drogowej, mostowej, konstr-budowlanej. Zatrudniony w Urz\u0119dzie Marsza\u0142kowskim w Departamencie Dr\xF3g i Publicznego Transportu Zbiorowego na stanowisku g\u0142\xF3wnego specjalisty oraz wykonuje wolny zaw\xF3d inspektora nadzoru inwestorskiego."),h(),p(12,"p"),g(13,"W ostatnich 10 latach nadzorowa\u0142 najwi\u0119ksze budowy z bran\u017Cy infrastruktury komunikacyjnej na Podkarpaciu takie jak modernizacja magistrali kolejowej E30 Krak\xF3w - Przemy\u015Bl, modernizacja stacji Rzesz\xF3w G\u0142\xF3wny oraz stacji Rzesz\xF3w Zachodni, budowa linii kolejowej do Portu Lotniczego Rzesz\xF3w -Jasionka (PKA), budowa kolejowych przystank\xF3w osobowych: S\u0119dzisz\xF3w Wschodni, Rzesz\xF3w Dworzysko, Rzesz\xF3w Baran\xF3wka, Rzesz\xF3w Pobitno, Kolbuszowa G\xF3rna, G\u0142og\xF3w M\u0142p Niwa, Zaczernie, Rzesz\xF3w Staromie\u015Bcie, Rzesz\xF3w Centrum, Rzesz\xF3w Politechnika, Boguchwa\u0142a Dolna, Lutory\u017C, Zabor\xF3w, \u017Barnowa, przebudowa stacji Strzy\u017C\xF3w oraz Kolbuszowa."),h(),p(14,"p"),g(15,"Dodatkowo nadzorowa\u0142 budow\u0119 dworca kolejowego w Kolbuszowej, nastawni Rzesz\xF3w G\u0142\xF3wny, budynku przeka\u017Anikowni w stacji Rzesz\xF3w G\u0142\xF3wny, budynku sekcji drogowej w stacji Rzesz\xF3w G\u0142\xF3wny, nastawni na Zaczerniu oraz na Staroniwie. Nadzorowa\u0142 Budow\u0119 S- 19 na odcinku Rzesz\xF3w -Babica. Obecnie nadzoruje przebudow\u0119 bocznicy kolejowej w Ja\u015Ble. W latach 2002-2014 by\u0142 Radnym Rady Miasta Rzeszowa. Natomiast w latach 2008-2014 by\u0142 Prezesem rzeszowskiego stowarzyszenia \u201EMosty dla Demokracji\u201D. Od wielu lat wspiera Konfederacj\u0119 jako ekspert do spraw inwestycji. Jest \u017Conaty ma dw\xF3ch syn\xF3w. Zainteresowania: samorz\u0105d, polityka wschodnia, inwestycje budowlane, surwiwal."),h(),A(16,"hr"),p(17,"div",6)(18,"a",7),g(19,"\u2190 Strona g\u0142\xF3wna"),A(20,"span",8),h()()())},dependencies:[Be]});let e=t;return e})();var Kf=(()=>{let t=class t{};t.\u0275fac=function(o){return new(o||t)},t.\u0275cmp=Y({type:t,selectors:[["app-postulaty"]],standalone:!0,features:[K],decls:62,vars:0,consts:[[1,"position-relative","overflow-hidden","p-3","p-md-5","m-md-3","text-center",2,"background-image","url('assets/images/zdRatusz.jpg')","background-size","cover","background-position","center"],[1,"col-md-5","p-lg-5","mx-auto","my-5","rounded","bg-dark","text-white",2,"opacity","0.8"],[1,"display-4","font-weight-bold"],[1,"product-device","box-shadow","d-none","d-md-block"],[1,"product-device","product-device-2","box-shadow","d-none","d-md-block"],[1,"col-lg-8","col-md-10","mx-auto",2,"padding","0 10px"],[1,"section-heading"],[1,"clearfix"],["routerLink","/",1,"btn","btn-primary","float-left"],[1,"d-none","d-md-inline"]],template:function(o,i){o&1&&(p(0,"div",0)(1,"div",1)(2,"h1",2),g(3,"Postulaty"),h()(),A(4,"div",3)(5,"div",4),h(),g(6," \xA0 "),p(7,"div",5)(8,"h2",6),g(9,"Jako Radny Rady Miasta Rzeszowa b\u0119d\u0119 d\u0105\u017Cy\u0142 do powstania:"),h(),g(10,`
